# Description:  This program is used to calculate the Inner and Outter diameter for a flat pattern used in fabricating metal expansion joints from design dimensions of a finished, formed expansion joint found on industrial drawings.
#               Requires the follwing inputs:
#               -Formed bellows O.D., Flange - Straight Flange, Flange - Knuckle Radius
#               -Formed bellows I.D., Flue - Straight Flange, FLue - Knuckle Radius      
# Version: 1.3

import tkinter as tk
from tkinter import ttk, font
from PIL import Image, ImageTk
import base64
import io

# Functions
def decode_img(encoded_data):
    decoded_data = base64.b64decode(encoded_data)
    return Image.open(io.BytesIO(decoded_data))

def decode_icon(encoded_data):
    decoded_data = base64.b64decode(encoded_data)
    return io.BytesIO(decoded_data).read()

def set_icon(window, icon_data):
    image_data = decode_icon(icon_data)
    photo = ImageTk.PhotoImage(data=image_data)
    window.tk.call('wm', 'iconphoto', window._w, photo)
  
def open_modify_window(entry_name, disclaimer_text, image_data, main_window_icon_data):
    
    modify_window = tk.Toplevel()
    modify_window.title(f"{entry_name}")
    modify_window.geometry("450x350")

    disclaimer_label = ttk.Label(modify_window, text=disclaimer_text)
    disclaimer_label.pack(pady=10)

    # Set the icon for the new window
    if main_window_icon_data:
        set_icon(modify_window, main_window_icon_data)

    #disclaimer_label = ttk.Label(modify_window, text=disclaimer_text)
    #disclaimer_label.pack(pady=10)

    if image_data:
        image = decode_img(image_data)
        image = image.resize((345, 229))
        photo = ImageTk.PhotoImage(image)

        image_label = ttk.Label(modify_window, image=photo)
        image_label.photo = photo
        image_label.pack(pady=10)

def calculate_values():
    try:
        od_sf = float(entry_ODSF.get())
        od_flg_kr = float(entry_ODflgKR.get())
        bellow_od = float(entry_BellowOD.get())
        id_sf = float(entry_IDSF.get())
        id_flg_kr = float(entry_IDflgKR.get())
        bellow_id = float(entry_BellowID.get())

        pi = 3.14159
                
        # Calculate "Cut O.D."
        cut_od = 2 * od_sf + od_flg_kr * pi - 2 * od_flg_kr + bellow_od
        cut_od_rounded = round(cut_od, 2)
        label_cut_od.config(text=f"Flat layout OD: \t{cut_od_rounded}\"")

        # Calculate "I.D. Minus"
        note = 0
        if od_flg_kr != 1.5 and od_flg_kr != 2:
            note = 1
            
        if id_flg_kr != 1.5 and id_flg_kr != 2:
            if note == 1:
                note = 3
            else:
                note = 2
            
        if note == 0:
            label_note.config(text="")
        if note == 1:
            label_note.config(text="Note: Flange Knuckle radius is outside normal values of 1.5\" or 2\"")
        
        elif note == 2:
            label_note.config(text="Note: Flue Knuckle radius is outside normal values of 1.5\" or 2\"")
            
        elif note == 3:
            label_note.config(text="Note: Both knuckle radii are outside normal values of 1.5\" or 2\"")

        # Calculate "Cut I.D."
        cut_id = bellow_id - 2 * id_sf + 2 * id_flg_kr - id_flg_kr * pi
        cut_id_rounded = round(cut_id, 2)  # Round to 2 decimal places
        label_cut_id.config(text=f"Flat layout ID: \t{cut_id_rounded}\"")
        
    except ValueError:
        label_cut_od.config(text="Invalid input. Please enter numerical values.")
        label_cut_id.config(text="Invalid input. Please enter numerical values.")
        label_note.config(text="")
       
